import React from "react";
export default class Modal extends React.Component {
    state = {
    show: false
  };
  showModal = e => {
    this.setState({
      show: true
    });
  };
  render() {
    return <button  onClick={e => {
              this.showModal();
         }}
          > show Modal </button>;
  }
}
